B.Bn=new A.eE("# Fluttercon 2023 Recap \ud83d\udc26\n\nInnovation and learning are key! We sent our entire app team (Niels, Job, Nick and [myself](https://twitter.com/bassiuz)) to Fluttercon/Droidcon Berlin to learn about the newest technologies in Flutter and Android development. It was three days packed with cutting-edge tech, tips, tricks, and best practices that we can apply in our daily work. We learned a lot and, most importantly, had a fun week meeting many Flutter developers and companies from around the world. Let us take you through our experience in this Fluttercon Recap!\n\nEvery day at Fluttercon starts with a keynote speaker in the largest room of the conference, followed by multiple talks split across four rooms for the remainder of the day. The first talks are meant to inspire and prepare attendees for the information they will learn throughout the day.\n\n## Day 1: Designing for Flutter\n\nOn the first day, [Todd Volkert](https://twitter.com/VolkertTodd), currently the Engineering Director for Flutter at Google, gave an excellent keynote. It's great to see Google being represented by influential figures in Flutter at this conference, which demonstrates confidence in Flutter as a platform and technology stack for the future.\n\nDuring Todd's talk about the future of Flutter, one of the most impressive things was a demo where a Flutter app could be run as a CLI app. It was unbelievable to see actual images, clicks, and animations in a terminal, even through SSH!\n\nFor me, Day 1 had a clear theme: Figma! \ud83c\udfa8 There are many changes happening in Figma that improve collaboration between developers and designers. We're also working on improving collaboration between designers and developers (see our [blog about Fluid UI](https://dutchcodingcompany.com/blog/responsive-design-in-flutter-meet-fluid-ui), for example), so this interested us a lot.\n\n[Jens Horstmann](https://twitter.com/jens_hor) gave a great talk about Figma and his startup [Widgetbook.io](http://widgetbook.io/), a new tool we're experimenting with to showcase our UI elements in a nice catalog. I must say, this slide made me laugh, as the text says it all \ud83d\ude42\n\n![Untitled](assets/assets/blogpost/fluttercon-2023/fluttercon-1.png)\n\nIn between good talks there was also some room for fun and games. Balancing on a balanceboard is a lot harder then it looks! [https://twitter.com/dutchcodingcom/status/1676547707974852610?s=20](https://twitter.com/dutchcodingcom/status/1676547707974852610?s=20)\n\n(follow us on Twitter!)\n\n## Day 2: Testing\n\nDay 2 began with a keynote by [Eric Seidel](https://twitter.com/_eseidel), the founder of Flutter. One of his main points was that as a community, we need to pave the way for the next 10 million Flutter developers. This means we, as developers, need to write documentation, tutorials, open-source packages, and other information that can guide new developers in this domain.\n\nAt Dutch Coding Company, we already try to contribute to the open-source community as much as possible. We help out with packages we use frequently, and we share packages and tools we developed. However, Eric's speech motivated us to do even more.\n\nDuring some downtime at the conference, I (Bas) wrote a small improvement Pull Request that resolves an issue I submitted to Widgetbook. I will discuss this further in a later blog post, so be sure to keep an eye on our socials! \ud83d\udc40\n\nOn the second day, we attended talks about testing. Personally, I like this subject as I cannot go without testing my code. Making testing easier is an important aspect of improving as a developer. The [Checks package](https://pub.dev/packages/checks) is a new package developed by the Flutter team to significantly improve your testing. Surprisingly, only 5 developers in a full room knew about this \"official\" package! So, grab this hot new tech while you can \ud83d\ude0a.\n\n![Untitled](assets/assets/blogpost/fluttercon-2023/fluttercon-2.png)\n\nAs an app agency, we conduct code audits when customers want us to maintain and expand their existing codebases. Although we have a good process for checking the quality of the codebase, it's always helpful to see how others do it. Darja Orlova provided us with helpful guidance and resources to improve our process. You can check out the resources for yourself here:\n[https://github.com/darjaorlova/fluttercon23-code-audit-resources](https://github.com/darjaorlova/fluttercon23-code-audit-resources)\n\nAfter a day of good learning but a lot of sitting, we needed to do something to get our blood pumping. Luckily, there was a cool climbing location next to our hotel, so we decided to go for it! And while Eric Seidel had inspired us earlier, he was clearly inspired by us according to his Twitter reply. Eric, you're invited next time! \ud83c\udf89\n\n![Untitled](assets/assets/blogpost/fluttercon-2023/fluttercon-3.png)\n\n## Day 3: the future\n\nIf I had to summarize the third day of the conference in one word, I would say it was about the future (and no, not just async calls \ud83d\ude09). Most of the talks were focused on how our landscape could look in the future, from the keynote about the culture of Flutter teams to using Dart in the backend with Serverpod.\n\nThe coolest talk, in my opinion, was by [Moritz Theis](https://twitter.com/MoritzTheis) about running Flutter on his coffee machine. Yes, you heard it right - a coffee machine! eFlutter can now be used on embedded devices to create great user interfaces that look and feel just like your mobile app would.\n\nWe have experience in making companion apps to hardware devices, and thinking about a future where we build actual apps on embedded systems sounds amazing!\n\n![Untitled](assets/assets/blogpost/fluttercon-2023/fluttercon-4.png)\n\n## Experience never to forget\n\nIn conclusion, it was a great week of learning, networking, and team building. We learned a lot about Flutter, but I also got to know my colleagues better. To quote David from [Very Good Ventures](https://verygood.ventures/), who spoke on day three: \"Teams working with Flutter tend to build great team cultures.\" This is very true for our team, and the week only made us stronger. \u2764\ufe0f\n\nAfter returning from Fluttercon, we applied some of the things we learned to our projects, resulting in improved code quality. But most importantly, I believe this experience will continue to inspire us for a long time to come. Until next year, Fluttercon!\n\n![Untitled](assets/assets/blogpost/fluttercon-2023/fluttercon-5.png)","Fluttercon 2023 Recap \ud83d\udc26","fluttercon-2023","20 / 7 / 2023","Innovation and learning are key! We sent our entire app team (Niels, Job, Nick and myself) to Fluttercon/Droidcon Berlin to learn about the newest technologies in Flutter and Android development. It was three days packed with cutting-edge tech, tips, tricks, and best practices that we can apply in our daily work. We learned a lot and, most importantly, had a fun week meeting many Flutter developers and companies from around the world. Let us take you through our experience in this Fluttercon Recap!",B.AR,5,"fluttercon2023")
B.Bo=new A.eE("# Developing Alibi with Flutter for Web: Our Success Story\n\n\u200c\u200c \nAs a team, we recently took on our first real web project for a client using Flutter, and we're excited to say that it was a success! The app we developed is called Alibi, and we're thrilled with the outcome. In this blog post, we'll share our experience developing Alibi with Flutter for Web and how it exceeded our expectations.\n\n\u200c\u200c \n## Introducing: Alibi\n\n\u200c\u200c \nAlibi is a web tool that helps plan busy workdays. Fill in all the projects you are currently working on, with an estimation of how long each phase is going to take and in what time frame it needs to be finished, and Alibi does the rest. With Alibi, you\u2019ll get a good overview of what work needs to be done, and it will plan your workload for you.\n\n\u200c\u200c \nFor the tool to be functional, it needs to load a lot of data from the user to give an overview of all the possible projects they are managing. Interactivity is also very important, as it should feel like a breeze to use Alibi. Alibi is only going to work if it feels like Alibi is helping you create your planning, instead of having the feeling you have to plan it \u2018in\u2019 Alibi yourself.\n\n\u200c\u200c \nBecause this tool is so focused on putting in and managing a lot of hours, it is mainly going to be used on desktop computers.\n\n\u200c\u200c \n![Alibi Desktop](assets/assets/blogpost/developing-alibi/alibi-laptop.jpg)\n\n\u200c\u200c \n## Why Flutter?\n\n\u200c\u200c \nBecause user interaction is so important for Alibi, we wanted to use a framework that allows us to do that. We\u2019re right at home making complex interactions in Flutter, so using that would make it a lot easier.\n\n\u200c\u200c \nThe customer had a mobile app on his plans as a dot on the horizon. So we already made sure we set up to transition to mobile when needed. With Flutter, we could reuse a whole lot of widgets and all the interaction we did with the backend.\n\n\u200c\u200c \nAround the time of launching Alibi, we noticed that Google was putting a lot of emphasis on Flutter Web. It got a lot of attention during keynotes, and more and more features and improvements were brought to Flutter Web since our last experiment with it. This gave us the confidence that Flutter Web is here to stay, and we could build this app in Flutter.\n\n\u200c\u200c \n\u200c\u200c \n## Performance\n\n\u200c\u200c \nSomething that immediately comes to mind is performance; is Flutter Web performant enough? The short answer is, if you don\u2019t mind the initial bump, it is!\n\n\u200c\u200c \nThe first time you are going to build a Flutter Web app, you\u2019ll notice that starting it from the browser is pretty slow. But it makes sense, right? You are not pre-installing the code on your device and running it; no, you need to download it whenever you load the URL in your browser. This means you basically do a small \u2018install\u2019 of your app whenever you open the app.\n\n\u200c\u200c \nBut once you are past that initial load, it is actually quite fast! Animations and transitions look smooth, and interactions are just like you are used to on the web!\n\n\u200c\u200c \nSo when is performance a problem in Flutter Web? If you need that first couple of seconds on your platform to matter; I think you should stay away. On most webshops, a customer decides to buy something in just a couple of seconds! If your page takes too long to load, they are gone. But if you intend to capture the attention of your user for a longer period of time, Flutter for Web is actually quite a good option.\n\n\u200c\u200c \nOh, and remember when I said Google was pushing it with Flutter for Web? They\u2019ve announced recently that they are going to support Web Assembly, which will improve performance by a lot!\n\n\u200c\u200c \n\u200c\u200c \n## User Interaction\n\n\u200c\u200c \nA very important view in Alibi is the Project overview, where you can expand and collapse projects, drag, drop and extend phases with nice interactions and scroll through time. This needs to feel very \u2018smooth\u2019 for it to have the wanted impact on the application, and it can be in Flutter!\n\n\u200c\u200c \nOne of the most challenging parts of this project was to create this view. One single phase bar needed to be interacted with in multiple ways. What happens when;\n\n\u200c\u200c \n- You hover over it?\n- You click on it?\n- You drag it? Are you dragging from the middle, or are you extending it by dragging from the edges?\n\n\u200c\u200c \nWith all kinds of animations of picking the items up, dropping them back in, extending and increasing/decreasing the intensity, a lot needed to be handled on a single input item. Fortunately, this is what Flutter is made for! And this interactive item will look the same on all different devices, if we want to.\n\n\u200c\u200c \nTry the interaction for yourself! Open up a browser, go to [https://app.alibitoday.com](https://app.alibitoday.com/), open up a free example account and feel the magic \u2728!\n\n\u200c\u200c \n\u200c\u200c \n## Turn of Events \ud83d\ude31\n\n\u200c\u200c \nAfter a couple of sprints, we had a launchable MVP; great! We wanted to see what the product would do in the market and navigate our next steps based on feedback from actual production users; this is what agile is all about!\n\n\u200c\u200c \nSo our browser-only app entered the hands of our potential new customers, and what did we find out? Most of our visits are from phones! Oh no; our app is only usable on desktop at the moment!\n\n\u200c\u200c \nThis made us quickly shift our focus, how can we bring the Alibi experience to mobile. We decided that we were just going to build the Alibi app from the codebase we already have and try and see what we can do in this last sprint. To all of our surprises, we actually managed to build the whole app in **1 sprint!**\n\n\u200c\u200c \nWhile this will not be the case for most apps, and we had to do some compromises on the interactive experience and more complex views, we actually managed to deliver the Alibi app to the app stores with a working and usable app!\n\n\u200c\u200c \nThis would not be possible if we chose to build the app in a web framework in the first place.\n\n\u200c\u200c \n![Alibi Phone](assets/assets/blogpost/developing-alibi/alibi-phone.jpg)\n\n\u200c\u200c \n## Conclusion: What Would We Do Now?\n\n\u200c\u200c \nOf course, the question that closes this story is what we would do with the knowledge we have now. For Alibi, it is obvious; Flutter Web was the right choice!\n\n\u200c\u200c \nWhile it depends on the kind of app that we would build next, I would not be afraid to propose Flutter Web for a next project. If the initial loading bump is not a problem, and obvious things such as SEO are not that important, it is actually a great choice for our team and for an app that possibly wants a mobile app in the future.\n\n\u200c\u200c \nFlutter for Web is not usable for every application, but in some cases, it gives you a whole lot of extras for free!\n\n\u200c\u200c \n### \ud83d\udcaa\ud83c\udffc Where it excels\n\n- Mobile and web in one codebase\n- Great cross-platform UI building\n\n\u200c\u200c \n### \ud83e\udee4 Where it doesn't shine\n\n- Bad initial loading time\n- Not SEO-friendly (yet!)\n\n\u200c\u200c \n\nI hope this gave you a good insight into our experience with Flutter for Web. If you have any questions about whether you should use it or need in-depth technical information, feel free to contact me, and I'll see what I can do for you!\n","Developing Alibi with Flutter for Web: Our Success Story","developing-alibi","18 / 4 / 2023","Alibi is a web tool that helps plan busy workdays. Fill in all the projects you are currently working on, with an estimation of how long each phase is going to take and in what time frame it needs to be finished, and Alibi does the rest. With Alibi, you\u2019ll get a good overview of what work needs to be done, and it will plan your workload for you.",B.m1,7,"developingAlibi")
